import * as React from 'react';
import { Modal, Portal, Text, Provider } from 'react-native-paper';

export const Layout = ({ show, handleShow }) => (
    <Provider>
        <Portal>
            <Modal visible={show} onDismiss={handleShow}>
                <Text>Example Modal</Text>
            </Modal>
        </Portal>
    </Provider>
)
